    }

    const data=JSON.stringify(user)
    if(localStorage.getItem("vmisJwt")!==null){
        Axios.put('http://192.168.0.120:8765/api/auth',data)
        .then(res=>{
            // localStorage.removeItem("vmisJwt");
            history.push("/login")

        })
        .catch(er=>{
            console.log(er)
            history.push("/login")

        })

    }
